import React from 'react';
import { Grid, Paper, Typography } from '@material-ui/core';


export default function Content() {
    return (
        <Grid container>

            <Grid item sm>
                <Paper>
                    <Typography variant = "button" color = "black">
                    </Typography>
                </Paper>
            </Grid>
        </Grid>
    )
}
